import React from 'react'
import Navbar from './Navbar';
import Strokebtn from './Strokebtn';
import "./css/Details.css";
import profile from "./Images/profile.jpeg";
import '.css/createEvent.css';
export const CreateEvent = () => {
    const imageStyling = {
        marginTop: '15rem',
        marginLeft: '11rem',
        filter: 'brightness(50%)'

    }
    const buttonStyle={
        height:'3rem',
        width:'13rem',
        borderRadius: '2rem',
        backgroundColor:'white',
        fontFamily:'Helvetica'
    }
  return (
    <div>
        <Navbar />
        <div className='page-name'>
          <Strokebtn title="Event create" fill="btn fill" />
        </div>
        <div className="absolute top-30 right-0 mr-20 mt-20">
      <div className="rounded-full h-20 w-20 overflow-hidden border-white border-2">
        <img
          className="object-cover h-full w-full"
          src={profile}
          alt="Profile"
        />
      </div>
    </div>
    <img
    style = {imageStyling}
    src = {profile} alt="profile"></img>
    <button style= {buttonStyle}>Add a banner</button>
    </div>
  )
}
export default CreateEvent;
